import { useContext } from 'react'
import { ProductsContext } from '../../context/products.context'

const Shop = () => {
  const { products } = useContext(ProductsContext)
  return (
    <div className='shop-container'>
      {products.map(({ id, name, imageUrl }) => (
        <div key={id}>{name}</div>
      ))}
    </div>
  )
}

export default Shop
